import styled from 'styled-components';

const Wrapper = styled.div`

  @media(min-width: 1024px) {
    background-color: black;
    border-radius: 50%;
    color: white;
    display: flex;
    flex-direction: column;
    height: 400px;
    width: 400px;
  }
`;

export {
  Wrapper
};
